import React, { Component } from 'react'
import fetch from 'isomorphic-unfetch'

export default class extends Component {
  static async getInitialProps() {
    console.log('start');
    const res = await fetch("http://localhost:3001/getproperties");
    console.log('res ' + JSON.stringify(res));
    const data = await res.json()
    console.log('xxxx ' + JSON.stringify(data));


    /*
    return {
      title: data.title,
      imageUrl: data.url
    }
    */
   data.map((entry, index) => {
    console.log('yy' + entry.address.streetAddress)
   })

  //  return res;
    return {
      values: data,
    }
  }

  renderTableData() {
    const abs = {
      position: "absolute"
    }
    console.log('renderTableData ------------------' + JSON.stringify(this.props.values));
    return this.props.values.map((entry, index) => {
      const address = entry.address;
       return (
          <tr key={address.streetAddress}>
             <td>
             <div>{address.streetAddress}</div>
             <div style={abs}> <a href={entry.url}><img src={entry.image}  width="300" height="300" /></a></div>
             </td>
          </tr>
       )
    })
 }


  render() {
    return (
       <div>
          <h1 id='title'>React Dynamic Table</h1>
          <table id='students'>
             <tbody>
                {this.renderTableData()}
             </tbody>
          </table>
       </div>
    )
 }
}
